Creating migrations/20160815133237_create_posts/down.sql Migrations allow us to evolve the database schema over time. Each migration can be applied (up.sql) or reverted (down.sql). Applying and immediately reverting a migration should leave your database schema unchanged. Next, we'll write the SQL for migrations: up.sql ( view on GitHub ): CREATE TABLE posts ( id SERIAL PRIMARY KEY, title VARCHAR NOT NULL, body TEXT NOT NULL, published BOOLEAN NOT NULL DEFAULT 'f'
) down.sql: DROP TABLE posts We can apply our new migration: diesel migration run It's a good idea to make sure that down.sql is correct. You can quickly confirm that your down.sql rolls back your migration correctly by redoing the migration: diesel migration redo A Note on Raw SQL in Migrations: Since migrations are written in raw SQL, they can contain specific features of the database system you use. For example, the CREATE TABLE statement above uses PostgreSQL's SERIAL type. If you want to use SQLite instead, you need to use INTEGER instead. A Note on Using Migrations in Production: When preparing your app for use in production, you may want to run your migrations during the application's initialization phase. You may also want to include the migration scripts as a part of your code, to avoid having to copy them to your deployment location/image etc. The diesel_migrations crate provides the embed_migrations! macro, allowing you to embed migration scripts in the final binary. Once your code uses it, you can simply include embedded_migrations::run(&db_conn) at the start of your main function to run migrations every time the application starts.

