Most applications fall into a category called "CRUD" apps. CRUD stands for "Create, Read, Update, Delete". Diesel provides support for all four pieces, but in this guide we're going to look at all the different ways to go about updating records. An update statement is constructed by calling diesel::update(target).set(changes). The resulting statement is then run by calling either execute, get_result, or get_results. If you look at the documentation for update , you'll notice that the type of the argument is any type T which implements IntoUpdateTarget. You don't need to worry about what this trait does, but it is important to know which types implement it. There are three kinds which implement this trait. The first is tables. If we have a table that looks like this: src/lib.rs ( view on GitHub ): table! { posts { id -> BigInt, title -> Text, body -> Text, draft -> Bool, publish_at -> Timestamp, visit_count -> Integer, }
} We could write a query that publishes all posts by doing: src/lib.rs ( view on GitHub ): use posts::dsl::*; diesel::update(posts).set(draft.eq(false)) We can use the debug_query function to inspect the generated SQL. The output you see may slightly differ from this guide, depending on which backend you're using. If we run println!("{}", debug_query::<Pg, _>(&our_query));, we'll see the following: Generated SQL ( view on GitHub ): UPDATE "posts" SET "draft" = $1 -- binds: [false] This is pretty much one-to-one with the Rust code (the ? denotes a bound parameter in SQL, which will be substituted with false here). It's quite rare to want to update an entire table, though. So let's look at how we can scope that down. The second kind that you can pass to update is any query which has only had .filter called on it. We could scope our update to only touch posts where publish_at is in the past like so: src/lib.rs ( view on GitHub ): use posts::dsl::*;
use diesel::expression::dsl::now; let target = posts.filter(publish_at.lt(now));
diesel::update(target).set(draft.eq(false)) That would generate the following SQL: Generated SQL ( view on GitHub ): UPDATE `posts` SET `draft` = ?
WHERE `posts`.`publish_at` < CURRENT_TIMESTAMP The most common update queries are just scoped to a single record. So the final kind that you can pass to update is anything which implements the Identifiable trait . Identifiable gets implemented by putting #[derive(Identifiable)] on a struct. It represents any struct which is one-to-one with a row on a database table. If we wanted a struct that mapped to our posts table, it'd look something like this: src/lib.rs ( view on GitHub ): #[derive(Identifiable)]
pub struct Post { pub id: i32, pub title: String, pub body: String, pub draft: bool, pub publish_at: SystemTime,
} The struct has one field per database column, but what's important for Identifiable is that it has the id field, which is the primary key of our table. Since our struct name is just the table name without an s, we don't have to provide the table name explicitly. If our struct were named something different, or if pluralizing it was more complex than putting an s on the end, we would have to specify the table name by adding #[table_name="posts"]. We're using SystemTime here since it's in the standard library, but in a real application we'd probably want to use a more full-featured type like one from chrono, which you can do by enabling the chrono feature on Diesel. If we wanted to publish just this post, we could do it like this: src/lib.rs ( view on GitHub ): diesel::update(&post).set(posts::draft.eq(false)) It's important to note that we always pass a reference to the post, not the post itself. When we write update(post), that's equivalent to writing update(posts.find(post.id)), or update(posts.filter(id.eq(post.id))). We can see this in the generated SQL: Generated SQL ( view on GitHub ): UPDATE `posts` SET `draft` = ? WHERE `posts`.`id` = ? Now that we've seen all the ways to specify what we want to update, let's look at the different ways to provide the data to update it with. We've already seen the first way, which is to pass column.eq(value) directly. So far we've just been passing Rust values here, but we can actually use any Diesel expression. For example, we could increment a column: src/lib.rs ( view on GitHub ): use posts::dsl::*; diesel::update(posts).set(visit_count.eq(visit_count + 1)) That would generate this SQL: Generated SQL ( view on GitHub ): UPDATE `posts`
SET `visit_count` = `posts`.`visit_count` + 1 Assigning values directly is great for small, simple changes. If we wanted to update multiple columns this way, we can pass a tuple. src/lib.rs ( view on GitHub ): use posts::dsl::*; diesel::update(posts) .set(( title.eq("[REDACTED]"), body.eq("This post has been classified"), )) This will generate exactly the SQL you'd expect: Generated SQL ( view on GitHub ): UPDATE `posts` SET `title` = ?, `body` = ?

