} If you just want to see the full simplified code and look through it yourself, you will find it at the end of this guide. The output of table! is always a Rust module with the same name. The first and most important part of this module will be the definition of the table itself: pub struct table; This is the struct that represents the user's table for the purpose of constructing SQL queries. It's usually referenced in code as users::table (or sometimes just users, more on that in a bit). Next, we'll see there's a module called columns, with one struct per column of the table. pub struct id;
pub struct name;
pub struct hair_color; Each of these structs uniquely represents each column of the table for the purpose of constructing SQL queries. Each of these structs will implement a trait called Expression , which indicates the SQL type of the column. impl Expression for id { type SqlType = Integer;
} impl Expression for name { type SqlType = Text;
} impl Expression for hair_color { type SqlType = Nullable<Text>;
} The SqlType type is at the core of how Diesel ensures that your queries are correct. This type will be used by ExpressionMethods to determine what things can and cannot be passed to methods like eq. It will also be used by Queryable to determine what types can be deserialized when this column appears in the select clause. In the columns module you'll also see a special column called star. Its definition looks like this: pub struct star; impl Expression for star { type SqlType = ();
