The easiest and most common way to extend Diesel's query builder is by declaring a new SQL function. This can be used for functions defined by your database, or for built-in functions that Diesel doesn't support out of the box. Functions in SQL often have multiple signatures, making them difficult or impossible to represent in Rust. Because of this, Diesel only provides support for a small number of built-in SQL functions. Consider COALESCE. This function can take any number of arguments, and its return type changes based on whether any arguments are NOT NULL. While we can't easily represent that in Rust, we can use sql_function! to declare it with the exact signature we're using. use diesel::types::{Nullable, Text};
sql_function!(coalesce, Coalesce, (x: Nullable<Text>, y: Text) -> Text); users.select(coalesce(hair_color, "blue")) As this example shows, sql_function! converts its argument like other parts of the query builder. This means that the generated function can take both Diesel expressions, and Rust values to be sent with the query. The macro takes three arguments: A function name A type name A type signature The type signature uses the same syntax as a normal Rust function. However, the types given are SQL types, not concrete Rust types. This is what allows us to pass both columns and Rust strings. If we defined this function manually, it would look like this: fn coalesce<X, Y>(x: X, y: Y) -> Coalesce<X::Expression, Y::Expression>
where X: AsExpression<Nullable<Text>>, Y: AsExpression<Text>, The type name given as the second argument is almost never used. Instead, a helper type is generated with the same name as the function. This helper type handles Diesel's argument conversion. This lets us write coalesce<hair_color, &str> instead of Coalesce<hair_color, Bound<Text, &str>>.

