Often times it's useful to encapsulate a common SQL pattern. For example, if you're doing pagination on your queries, PostgreSQL is capable of loading the total count in a single query. The query you would want to execute would look like this: SELECT *, COUNT(*) OVER () FROM (subselect t) LIMIT $1 OFFSET $1 However, as of version 1.0, Diesel doesn't support window functions, or selecting from a subselect. Even if Diesel's query builder supported those things, this is a case that is easier to reason about in terms of the SQL we want to generate. Let's look at how we would go about adding a paginate method to Diesel's query builder, to generate that query. Let's assume for the time being that we have a struct Paginated<T> already. We'll look at the specifics of this struct shortly. If you are creating a struct where you want to manually define the SQL, you will need to implement a trait called QueryFragment. The implementation will look like this: src/pagination.rs ( view on GitHub ): impl<T> QueryFragment<Pg> for Paginated<T>
where T: QueryFragment<Pg>,
{ fn walk_ast(&self, mut out: AstPass<Pg>) -> QueryResult<()> { out.push_sql("SELECT *, COUNT(*) OVER () FROM ("); self.query.walk_ast(out.reborrow())?; out.push_sql(") LIMIT "); out.push_bind_param::<BigInt, _>(&self.limit())?; out.push_sql(" OFFSET "); out.push_bind_param::<BigInt, _>(&self.offset())?; Ok(()) }
} For details on what each method does, see the documentation for AstPass . One important question to ask whenever you implement QueryFragment is whether you are generating a query that is safe to cache. The way to answer this question is by asking "does this struct generate an unlimited number of potential SQL queries"? Typically that is only the case if the body of walk_ast contains a for loop. If your query is not safe to cache, you must call out.unsafe_to_cache_prepared. Whenever you implement QueryFragment, you also need to implement QueryId . We can use the impl_query_id! macro for this. Since this struct represents a full query which can be executed, we will implement RunQueryDsl which adds methods like execute and load . Since this query has a return type, we'll implement Query which states the return type as well. src/pagination.rs ( view on GitHub ): impl_query_id!(Paginated<T>); impl<T: Query> Query for Paginated<T> { type SqlType = (T::SqlType, BigInt);
} impl<T> RunQueryDsl<PgConnection> for Paginated<T> {} Now that we've implemented all of these things, let's look at how we would go about constructing this. We'll want to add a paginate method to all Diesel queries, which specifies which page we're on, as well as a per_page method which specifies the number of elements per page. In order to add new methods to existing types, we can use a trait. src/pagination.rs ( view on GitHub ): pub trait Paginate: AsQuery + Sized { fn paginate(self, page: i64) -> Paginated<Self::Query> { Paginated { query: self.as_query(), page, per_page: DEFAULT_PER_PAGE, } }
} impl<T: AsQuery> Paginate for T {} const DEFAULT_PER_PAGE: i64 = 10; pub struct Paginated<T> { query: T, page: i64, per_page: i64,
} impl Paginated<T> { pub fn per_page(self, per_page: i64) -> Self { Paginated { per_page, ..self } }
} Now we can get the third page of a query with 25 elements per page like this: users::table .paginate(3) .per_page(25) With this code, we could load any query into a Vec<(T, i64)>, but we can do better. When doing pagination, you usually want the records and the total number of pages. We can write that method. src/pagination.rs ( view on GitHub ): impl<T> Paginated<T> { fn load_and_count_pages<U>(self, conn: &PgConnection) -> QueryResult<(Vec<U>, i64) where Self: LoadQuery<PgConnection, (U, i64)>, { let per_page = self.per_page; let results = self.load::<(U, i64)>(conn)?; let total = results.get(0).map(|(_, total) total|).unwrap_or(0); let records = results.into_iter().map(|(record, _)| record).collect(); let total_pages = (total as f64 / per_page as f64).ceil() as i64; Ok((records, total_pages)) }
} This is one of the rare cases where we want to define a function that takes a connection. One benefit of defining the function this way is that if we wanted to support backends other than PostgreSQL, we could have this function execute two queries. You can find the full code for this example in the "advanced blog" example .

