If you're adding support for a new type to Diesel, or working with a type that has incomplete support, you may wish to add support for the operators associated with that type. The term operator refers to anything that uses one of these syntaxes: Infix (e.g. left OP right) Prefix (e.g. OP expr) Postfix (e.g. expr OP) Diesel provides helper macros for defining each of these kinds of operators. In fact, Diesel uses these macros to declare nearly all of the operators supported by the main crate. The macros are diesel_infix_operator! , diesel_postfix_operator! and diesel_prefix_operator! . All of these macros have the same signature. They take between two and four arguments. The first is the name of the struct you want to represent this operator. The second is the actual SQL for this operator. The third argument is optional, and is the SQL type of the operator. If the SQL type is not specified, it will default to Bool. You can also pass the "magic" type ReturnBasedOnArgs, which will cause the SQL type to be the same as the type of its arguments. Diesel uses this to make the string concatenation operator || return Nullable<Text> if the arguments are nullable, or Text if they are not null. The fourth argument (or third if you didn't specify the SQL type) is the backend this operator is used for. If you don't specify a backend, the operator can be used on all backends. Let's look at some example usage from Diesel: // A simple operator. It returns `Bool` and works on all backends.
diesel_infix_operator!(Eq, " = "); // Here we've specified the SQL type.
// Since this operator is only used for ordering, and we don't want it used
// elsewhere, we've made it `()` which is normally useless.
diesel_postfix_operator!(Asc, " ASC", ()); // Concat uses the magic `ReturnBasedOnArgs` return type
// so it can work with both `Text` and `Nullable<Text>`.
diesel_infix_operator!(Concat, " || ", ReturnBasedOnArgs); // This operator is PG specific, so we specify the backend
diesel_infix_operator!(IsDistinctFrom, " IS DISTINCT FROM ", backend: Pg); // This operator is PG specific, and we are also specifying the SQL type.
diesel_postfix_operator!(NullsFirst, " NULLS FIRST", (), backend: Pg); Diesel provides a proof-of-concept crate showing how to add new SQL types called diesel_full_text_search. These are the operators as they are defined in that crate. You'll notice all of the operators specify the backend, and many of them specify the return type. src/lib.rs ( view on GitHub ): diesel_infix_operator!(Matches, " @@ ", backend: Pg);
diesel_infix_operator!(Concat, " || ", TsVector, backend: Pg);
diesel_infix_operator!(And, " && ", TsQuery, backend: Pg);
diesel_infix_operator!(Or, " || ", TsQuery, backend: Pg);
diesel_infix_operator!(Contains, " @> ", backend: Pg);
diesel_infix_operator!(ContainedBy, " <@ ", backend: Pg); However, just declaring the operator by itself isn't very useful. This creates the types required by Diesel's query builder, but doesn't provide anything to help use the operator in real code. The structs created by these macros will have a new method, but that's not typically how you work with Diesel's query builder. Infix operators are usually methods on the left hand side. Postfix operators are usually methods on the expression. Prefix operators are usually bare functions. For operators that you create with methods, you would typically create a trait for this. For example, here's how the .eq method gets defined by Diesel. src/expression_methods/global_expression_methods.rs ( view on GitHub ): pub trait ExpressionMethods: Expression + Sized { fn eq<T: AsExpression<Self::SqlType>>(self, other: T) -> Eq<Self, T::Expression> { Eq::new(self, other.as_expression()) }
} impl<T: Expression> ExpressionMethods for T {} It's important to note that these methods are where you should put any type constraints. The structs defined by diesel_*_operator! don't know or care about what the types of the arguments should be. The = operator requires that both sides be of the same type, so we represent that in the type of ExpressionMethods::eq. You'll also notice that our argument is AsExpression<Self::SqlType>, not Expression<SqlType = Self::SqlType>. This allows Rust values to be passed as well as Diesel expressions. For example, we can do text_col.eq(other_text_col), or text_col.eq("Some Rust string"). If the operator is specific to only one SQL type, we can represent that in our trait. src/expression_methods/global_expression_methods.rs ( view on GitHub ): pub trait BoolExpressionMethods
where Self: Expression<SqlType = Bool> + Sized,
{ fn and<T: AsExpression<Bool>>(self, other: T) -> And<Self, T::Expression> { And::new(self, other.as_expression()) }
} impl<T: Expression<SqlType = Bool>> BoolExpressionMethods for T {} Prefix operators are usually defined as bare functions. The code is very similar, but without the trait. Here's how not is defined in Diesel. src/expression/not.rs ( view on GitHub ): pub fn not<T: AsExpression<Bool>>(expr: T) -> Not<Grouped<T::Expression>>
{ super::operators::Not::new(Grouped(expr.as_expression()))
} In this case we're using Grouped (which is currently undocumented in Diesel and only used internally) to add parenthesis around our argument. This ensures that the operator precedence in SQL matches what's expected. For example, we would expect not(true.and(false)) to return true. However, SELECT NOT TRUE AND FALSE returns FALSE. Diesel does the same thing with .or. It's also a best practice to expose a "helper type" for your method, which does the same type conversion as the method itself. Nobody wants to write Eq<text_col, <&str as AsExpression<Text>>::Expression>. Instead, we provide a type that lets you write Eq<text_col, &str>. src/expression/helper_types.rs ( view on GitHub ): pub type Eq<Lhs, Rhs> = super::operators::Eq<Lhs, AsExpr<Rhs, Lhs>>; For defining these types, you'll usually want to make use of SqlTypeOf , AsExpr , and AsExprOf .

